  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113955 includes biological,
  chemical, discrete sample, physical and profile data collected from Hakuho Maru
  in the Indian Ocean from 1994-12-13 to 1995-01-28 and retrieved during cruise CARINA/49HH19941213.
  These data include ALKALINITY, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect
  these data include CTD and bottle. These data were collected by Masao Ishii of Meteorological
  Research Institute; Geochemical Research Department and K. Kawaguchi and M. Terazaki
  [affiliation unknown] as part of the CARINA/49HH19941213 data set.nnThe CARINA (CARbon
  dioxide IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
